import React, { useEffect, useRef, useState } from 'react';
import './App.css';
import * as THREE from 'three';
import { GradientTexture } from '@react-three/drei'; // To use gradient textures for color transition
import profile from './profile.jpg';

function App() {
  const mountRef = useRef(null);
  const [flippingText, setFlippingText] = useState("trying to build cool stuff");

  useEffect(() => {
    const texts = ["trying to build cool stuff", "trying to meet new people"];
    let index = 0;
    const interval = setInterval(() => {
      index = (index + 1) % texts.length;
      setFlippingText(texts[index]);
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    const currentMount = mountRef.current;

    // Scene, Camera, Renderer setup
    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(50, window.innerWidth / window.innerHeight, 0.1, 1000);
    camera.position.set(0, 0, 600);

    const renderer = new THREE.WebGLRenderer({ alpha: true, antialias: true });
    renderer.setSize(window.innerWidth, window.innerHeight);
    renderer.setClearColor(0xffffff, 0);
    currentMount.appendChild(renderer.domElement);

    // Ambient light to soften the shadows
    const ambientLight = new THREE.AmbientLight(0xffffff, 0.6);
    scene.add(ambientLight);

    // Directional light for depth and shadowing
    const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
    directionalLight.position.set(200, 200, 300);
    directionalLight.castShadow = true;
    scene.add(directionalLight);

    // Create lighter color materials with gradients
    const createGradientMaterial = () => {
      return new THREE.MeshPhongMaterial({
        color: new THREE.Color().setHSL(Math.random(), 0.7, 0.8),
        shininess: 100,
        transparent: true,
        opacity: 0.9,
      });
    };

    // Geometry and Material
    const geometries = [
      new THREE.SphereGeometry(50, 32, 32), // Sphere
      new THREE.CylinderGeometry(40, 40, 100, 32), // Cylinder
      new THREE.BoxGeometry(80, 80, 80), // Cube with sharp edges initially
      new THREE.ConeGeometry(50, 100, 32), // Cone
    ];

    // Create shapes with gradient-like material and add to the scene
    const meshes = geometries.map((geometry, index) => {
      const material = createGradientMaterial();
      const mesh = new THREE.Mesh(geometry, material);
      mesh.position.x = (Math.random() - 0.5) * 800;
      mesh.position.y = (Math.random() - 0.5) * 600;
      mesh.position.z = (Math.random() - 0.5) * 400;
      mesh.castShadow = true;
      mesh.receiveShadow = true;
      scene.add(mesh);
      return mesh;
    });

    // Animation for rotating and gradient change
    const animate = () => {
      requestAnimationFrame(animate);
      meshes.forEach((mesh) => {
        mesh.rotation.x += 0.005;
        mesh.rotation.y += 0.005;

        // Update color over time to create gradient effect
        const hue = (mesh.rotation.x + mesh.rotation.y) % 1; // Calculate a dynamic hue based on rotation
        mesh.material.color.setHSL(hue, 0.6, 0.8);
      });
      renderer.render(scene, camera);
    };
    animate();

    // Cleanup
    return () => {
      currentMount.removeChild(renderer.domElement);
    };
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <div ref={mountRef} className="floating-shapes"></div>
        <div className="sliding-name-background">
          <div className="name-slide">Avi Desai • Avi Desai • Avi Desai</div>
        </div>
        <div className="hero-container">
          <div className="intro-text">
            <span className="greeting-text">Hi, I'm</span> <span className="name-text">Avi!</span>
          </div>
          <p className="flipping-text">{flippingText}</p>
          <img src={profile} alt="Avi" className="profile-picture" />
        </div>
      </header>

      <main className="App-main">
        <section className="bio-section">
          <h2>Bio</h2>
          <p>
            Passionate software engineer with extensive experience in frontend development, creating seamless and visually engaging user experiences.
          </p>
        </section>
      </main>
    </div>
  );
}

export default App;
